import React, { useState, useContext, useEffect } from "react";
import { GlobalContext } from "../context/GlobalState";
import QuoteCard from "../components/reusables/QuoteCard";
import Navigation from "../components/layout/Navigation";
import Modal from "../components/modals/Modal";
import { plans } from "../data";

const Quotes = () => {
  const { car_info, getCarInfo } = useContext(GlobalContext);

  const [selected, setselected] = useState("");

  useEffect(() => {
    getCarInfo(); // eslint-disable-next-line
  }, []);

  return (
    <>
      <div className="parent">
        <div className="main">
          <Navigation />
          <section className="quote-display">
            <div className="container-fluid">
              <div className="quote-details">
                <div className="row">
                  <div className="col-md-6 col-12">
                    <h4>Motor Insurance Quotes</h4>
                  </div>
                </div>
                <div className="row">
                  <div className="col-md-5 col-12">
                    <div className="sm-card"></div>
                  </div>
                  <div className="col-md-7 col-12">
                    <ul>
                      <li>
                        <label>ADD POLITICAL VIOLENCE</label>
                      </li>
                      <li>
                        <label>ADD EXCESS PROTECTOR</label>
                      </li>
                      <li>
                        <label>ADD AA RESCUE SERVICES</label>
                      </li>
                    </ul>
                  </div>
                </div>
              </div>
              <div className="row">
                {plans.map((p, i) => (
                  <div className="col-md-4 col-12" key={i}>
                    <QuoteCard
                      car_info={car_info}
                      plan={p}
                      setselected={setselected}
                    />
                  </div>
                ))}
              </div>
            </div>
          </section>
        </div>
        <Modal selected={selected} setselected={setselected} />
      </div>
    </>
  );
};

export default Quotes;
